data:
  definition: a conductor which has been cut and the insulation of which has been
    removed for insertion into a terminal
  examples: []
  notes:
  - A conductor the shape of which is arranged for introduction into a terminal or
    the strands of which are twisted to consolidate the end is considered as an unprepared
    conductor.
